
<!doctype html>
<html lang="ar" dir="rtl">
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>مساعد رمضان الذكي</title>

<style>
:root{
  --primary:#2f7fa3;
  --secondary:#5aa6c6;
  --cardblue:#dff2fb;
  --chat:#f4fbff;
}

body{
  margin:0;
  font-family:Tahoma, sans-serif;
  background:linear-gradient(180deg, #e9f4f9 0%, #d8edf7 60%, #c6e4f2 100%);
}

/* HEADER */
.header{
  padding:30px 80px;
  display:flex;
  align-items:center;
  justify-content:space-between;
  background:#ffffff;
  border-bottom:3px solid #d6eaf3;
  box-shadow:0 5px 15px rgba(0,0,0,.05);
}

.logo img{
  height:115px;   /* نفس المقاس للشعارين */
  width:auto;
  object-fit:contain;
}

.title{
  text-align:center;
  flex:1;
  color:var(--primary);
}

.title h1{
  margin:0;
  font-size:46px;
  font-weight:bold;
}

.title p{
  margin:10px 0 0 0;
  font-size:24px;
  color:var(--secondary);
}

/* CARD */
.card{
  max-width:1100px;
  margin:50px auto;
  background:var(--cardblue);
  padding:35px;
  border-radius:30px;
  box-shadow:0 20px 40px rgba(0,0,0,.08);
  color:#083040;
}

.chat{
  background:var(--chat);
  padding:30px;
  border-radius:20px;
  min-height:320px;
  font-size:20px;
  border:1px solid #c6e4f2;
}

.inputbar{
  display:flex;
  gap:15px;
  margin-top:20px;
}

input{
  flex:1;
  padding:16px;
  border-radius:16px;
  border:1px solid #c6e4f2;
  font-size:18px;
}

button{
  padding:16px 30px;
  border:none;
  border-radius:16px;
  background:var(--secondary);
  color:#083040;
  font-weight:bold;
  cursor:pointer;
}

button:hover{opacity:.9;}

@media(max-width:900px){
  .logo img{height:85px;}
  .title h1{font-size:30px;}
  .title p{font-size:18px;}
}
</style>
</head>
